import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  margin-top: 1rem;
  justify-content: space-between;
  width: 93%;
  align-self: center;
`;

const DetailSquare = styled.div`
  padding: 3rem 0;
  background-color: white;
  border-radius: 4px;
  box-shadow: 0 9px 28px 0 rgba(0, 0, 0, 0.03);
  background-color: #ffffff;
  flex-basis: 20%;
  text-align: center;

  font-family: PingFangSC;
  font-size: 14px;
  font-weight: normal;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.57;
  letter-spacing: normal;
  color: rgba(0, 0, 0, 0.45);
`;

const SquareContainer = styled.div`
display:flex;
`;
const Dot = styled.div`
  width: 6px;
  height: 6px;
  background-color: #2f9bff;
`;


const Summary = () => {
  return (
    <Container>
      <SquareContainer>
        <Dot></Dot>
        <Detail>Total</Detail>
      </SquareContainer>
      <Detail>Approved</Detail>
      <Detail>Declined</Detail>
      <Detail>Approval Rate</Detail>
    </Container>
  );
};

export default Summary;
